                t_xz_zzz[j] += fl_s_0_0_4 * (3.0 * pc_xzz[j] * fl1_fx + pa_x[j] * pc_zzzz[j] + pc_xzzz[j] * pa_z[j] + 3.0 * pc_xzzz[j] * pb_z[j]);

