                t_yy_xyz[j] += fl_s_0_0_4 * (1.5 * pc_xyz[j] * fl1_fx + 2.0 * pa_y[j] * pc_xyyz[j] + pc_yyyz[j] * pb_x[j] + pc_xyyz[j] * pb_y[j] + pc_xyyy[j] * pb_z[j]);

                t_yy_xyz[j] += -fl_s_0_0_5 * pc_xyyyz[j];
