                t_xx_xzzz[j] += fl_s_0_0_5 * (-1.5 * pc_xxxz[j] * fl1_fx - 1.5 * pc_xzzz[j] * fl1_fx - 2.0 * pa_x[j] * pc_xxzzz[j] - pc_xxzzz[j] * pb_x[j] - 3.0 * pc_xxxzz[j] * pb_z[j]);

