                t_yzzz_xz[j] += fl_s_0_0_5 * (-3.0 * pc_xyzz[j] * fl1_fx - pa_y[j] * pc_xzzzz[j] - 3.0 * pc_xyzzz[j] * pa_z[j] - pc_yzzzz[j] * pb_x[j] - pc_xyzzz[j] * pb_z[j]);

                t_yzzz_xz[j] += fl_s_0_0_6 * pc_xyzzzz[j];

