                t_zzzz_xx[j] += fl_s_0_0_5 * (-0.5 * pc_zzzz[j] * fl1_fx - 3.0 * pc_xxzz[j] * fl1_fx - 4.0 * pa_z[j] * pc_xxzzz[j] - 2.0 * pc_xzzzz[j] * pb_x[j]);

                t_zzzz_xx[j] += fl_s_0_0_6 * pc_xxzzzz[j];
